/*
  Hi guys,
  I know there are many good reasons to keep those javascript functions in separate files. Like
  - showing responsibility
  - encapsulation (Information hiding)
  - keeping separate things apart
  BUT: I have two good reasons to put them in one file
  - SAS has a limitation of characters that can be put in the header tag of an HTML page.
  - we are a SAS macro project and no javascript project
    So I prefer to use one longer name that let's recognise what's going on.
*/

